params_cv_LR = {'C': np.linspace(0.0001,1,1000), 'solver': ['newton-cg','sag','lbfgs']}
params_cv_KN = {'n_neighbors': np.linspace(1,50,50).astype(int)}
params_cv_SV = {'C': np.linspace(0.0001,0.1,1000), }
params_cv_QD = {'reg_param': np.linspace(0.0001,10,100)}

estimators = [LogisticRegression(), KNeighborsClassifier(), SVC(kernel='rbf'), QuadraticDiscriminantAnalysis()]
params_list = [params_cv_LR, params_cv_KN, params_cv_SV, params_cv_QD]

scores = []
for i, classifier in enumerate(estimators):
    grid = GridSearchCV(classifier, params_list[i], cv=5)
    grid.fit(feat, target)
    scores.append(grid.best_score_)
